package com.kuaixiu.recycle.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2018-12-04 下午05:02:18 * @version: V 1.0 */public class BrandText extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private Long id ;    /**     * 品牌     */    private String brand ;    /**     * 机型号     */    private String modelNo ;    /**     * 机型名称     */    private String modelName ;    /**     * 支持的软件版本号     */    private String editionNo ;    /**     * get:     */    public Long getId(){        return this.id;    }    /**     * set：     */    public void setId(Long id){        this.id=id;    }    /**     * get:品牌     */    public String getBrand(){        return this.brand;    }    /**     * set：品牌     */    public void setBrand(String brand){        this.brand=brand;    }    /**     * get:机型号     */    public String getModelNo(){        return this.modelNo;    }    /**     * set：机型号     */    public void setModelNo(String modelNo){        this.modelNo=modelNo;    }    /**     * get:机型名称     */    public String getModelName(){        return this.modelName;    }    /**     * set：机型名称     */    public void setModelName(String modelName){        this.modelName=modelName;    }    /**     * get:支持的软件版本号     */    public String getEditionNo(){        return this.editionNo;    }    /**     * set：支持的软件版本号     */    public void setEditionNo(String editionNo){        this.editionNo=editionNo;    }}